import React from 'react';
import Top from '../Top/Top';
import Bottom from '../Bottom/Bottom';
import Customs from '../Customs/Customs';

import Img1 from '../images/심사대리.jpg';

import styles from './Aboutaone.module.css';


const Consultation = () => {
    return (
    <div>
     
            <Top />
            <div className={styles.down}>심사 대리</div>
            <div class = "container">
                <br />
            <img src ={Img1} alt='심사대리' /><br />
            세관에서는 법인에 대하여  3년 내지 5년을 주기로 법인 심사를 실시하며, 산업 분야별, 특정 품목별 등 특정 분야별로 무역정보를 분석하여 기획심사를 실시 합니다. AEO(Authorized Economic Operator) 인증업체에 대하여는 종합 심사를 실시하고 있습니다.
세관심사는 세율 적용의 적정성, FTA협정 적용의 적정성, 과세가격의 정확성, 외환거래의 적정성 등 모든 통관의 적법성을 심사하게 됩니다.
<br /><br />
   <Customs />
            </div>
            <Bottom />
        </div>
    );
};

export default Consultation;
